<div class="row" ng-controller="attendance">

	<div class="row" ng-show="!registerWizard">
		<div class="row" style="padding-top:20px">
			<div class="col-md-4">
				<h2>Atendimento</h2>
			</div>

			<div class="col-md-4 pull-right" style="padding-top:20px" >
				<button ng-click="changeForRegisterWizard()" class="btn btn-blue pull-right">Registrar Atendimento</button>
			</div>
		</div>

		<hr class="whiter" />

		<div style="margin-top:-50px">
			<div class="panel-content col-sm-9">
				<div id="attendance" class="row">
					<div class="title">
						<h3><strong>{{user.userName}}, esses são seus desafios:</strong></h3>
					</div>
					<div  class="displayInfo" style="max-height:250px;min-height:250px;overflow: auto">
						<ul class="todo-list md-todo ui-sortable">
							<li ng-repeat="attendance in attendanceList">
								<div class="pull-left">
									<a href="#"><i class="{{attendance.iconClass}}"></i></a>
								</div>

								<label class="todo-task editable editable-click">{{attendance.description}}</label>

								<div class="checkbox checkbox-primary pull-right">
									<label>
										<input type="checkbox" name="r-primary" value="option1" class="md-checkbox">
										<span class="checkbox-material" style="padding-right:5px;">
									<span class="check"></span>
								</span>
									</label>
								</div>
							</li>
						</ul>
					</div>
				</div>

				<div id="Task" class="row">
					<div class="title">
						<h3><strong>{{user.userName}}, você deve tomar essas ações:</strong></h3>
					</div>
					<div  class="displayInfo" style="max-height:250px;min-height:250px;overflow: auto">
						<ul class="todo-list md-todo ui-sortable">
							<li ng-repeat="task in taskList">
								<div class="pull-left">
									<a href="#"><i class="{{task.iconClass}}"></i></a>
								</div>

								<label class="todo-task ">{{task.description}}</label>

								<div class="pull-right">
									<a href="#" ng-repeat="icon in task.icons"><i class="{{icon}}"></i></a>
								</div>
							</li>
						</ul>
					</div>
				</div>
			</div>
